<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Keith Yeung - Travel Map</title>
    <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css" />
    <script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"></script>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600&display=swap" rel="stylesheet">
    <style>
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { 
            font-family: 'Inter', -apple-system, BlinkMacSystemFont, sans-serif;
            background: #0f0f1a;
            color: #fff;
        }
        
        .header {
            background: linear-gradient(135deg, #1a1a2e 0%, #16213e 100%);
            padding: 30px 40px;
            border-bottom: 1px solid rgba(255,255,255,0.1);
        }
        .header h1 {
            font-size: 28px;
            font-weight: 600;
            margin-bottom: 8px;
        }
        .header p {
            color: #888;
            font-size: 14px;
        }
        .header a {
            color: #74b9ff;
            text-decoration: none;
        }
        
        .stats-bar {
            display: flex;
            gap: 40px;
            padding: 20px 40px;
            background: rgba(255,255,255,0.02);
            border-bottom: 1px solid rgba(255,255,255,0.05);
            flex-wrap: wrap;
        }
        .stat {
            text-align: center;
        }
        .stat-value {
            font-size: 32px;
            font-weight: 600;
            color: #74b9ff;
        }
        .stat-label {
            font-size: 12px;
            color: #666;
            text-transform: uppercase;
            letter-spacing: 1px;
        }
        
        .year-timeline {
            display: flex;
            padding: 15px 40px;
            gap: 4px;
            background: rgba(0,0,0,0.3);
            overflow-x: auto;
        }
        .year-chip {
            padding: 8px 16px;
            border-radius: 20px;
            font-size: 13px;
            font-weight: 500;
            cursor: pointer;
            transition: all 0.2s;
            white-space: nowrap;
            border: 2px solid transparent;
        }
        .year-chip:hover { transform: scale(1.05); }
        .year-chip.active { border-color: white; }
        .year-chip.no-data { 
            background: #333 !important; 
            color: #666;
            cursor: default;
        }
        
        #map {
            height: calc(100vh - 220px);
            min-height: 500px;
        }
        
        .footer {
            padding: 20px 40px;
            background: #0a0a12;
            text-align: center;
            font-size: 12px;
            color: #555;
        }
        .footer a { color: #74b9ff; text-decoration: none; }
        
        @media (max-width: 600px) {
            .header { padding: 20px; }
            .stats-bar { padding: 15px 20px; gap: 20px; }
            .stat-value { font-size: 24px; }
            .year-timeline { padding: 10px 20px; }
        }
    </style>
</head>

        const yearCounts = {"2009": 31, "2012": 121, "2013": 173, "2015": 445, "2016": 1939, "2017": 1737, "2018": 1653, "2019": 2145, "2020": 963, "2021": 491, "2022": 656, "2023": 1159, "2024": 897, "2025": 1630};
        const colors = {"2009": "#ff6b6b", "2010": "#4ecdc4", "2011": "#45b7d1", "2012": "#96ceb4", "2013": "#ffeaa7", "2014": "#dfe6e9", "2015": "#fd79a8", "2016": "#a29bfe", "2017": "#6c5ce7", "2018": "#00b894", "2019": "#e17055", "2020": "#0984e3", "2021": "#d63031", "2022": "#00cec9", "2023": "#fdcb6e", "2024": "#e84393", "2025": "#74b9ff"};
        
        const allYears = [];
        for (let y = 2009; y <= 2025; y++) allYears.push(y.toString());
        
        // Initialize map
        const map = L.map('map', {
            zoomControl: true,
            scrollWheelZoom: true
        }).setView([39.8283, -98.5795], 4);
        
        L.tileLayer('https://{s}.basemaps.cartocdn.com/dark_all/{z}/{x}/{y}{r}.png', {
            attribution: 'Â© OpenStreetMap Â© CARTO',
            maxZoom: 18
        }).addTo(map);
        
        // Layer groups per year
        const yearLayers = {};
        const activeYears = new Set(allYears);
        
        allYears.forEach(year => {
            yearLayers[year] = L.layerGroup().addTo(map);
        });
        
        // Add markers
        locations.forEach(loc => {
            const color = colors[loc.year] || '#888';
            L.circleMarker([loc.lat, loc.lng], {
                radius: 5,
                fillColor: color,
                color: 'rgba(255,255,255,0.3)',
                weight: 1,
                opacity: 1,
                fillOpacity: 0.8
            })
            .bindPopup('<strong>' + loc.date + '</strong>')
            .addTo(yearLayers[loc.year]);
        });
        
        // Build year chips
        const timeline = document.getElementById('yearTimeline');
        allYears.forEach(year => {
            const count = yearCounts[year] || 0;
            const chip = document.createElement('div');
            chip.className = 'year-chip' + (count === 0 ? ' no-data' : ' active');
            chip.style.background = count > 0 ? colors[year] : '#333';
            chip.style.color = count > 0 ? '#fff' : '#666';
            chip.textContent = year + (count > 0 ? ' (' + count + ')' : ' âŒ');
            
            if (count > 0) {
                chip.onclick = () => {
                    if (activeYears.has(year)) {
                        activeYears.delete(year);
                        map.removeLayer(yearLayers[year]);
                        chip.classList.remove('active');
                        chip.style.opacity = '0.4';
                    } else {
                        activeYears.add(year);
                        yearLayers[year].addTo(map);
                        chip.classList.add('active');
                        chip.style.opacity = '1';
                    }
                };
            }
            timeline.appendChild(chip);
        });
        
        // Fit to markers
        const coords = locations.map(l => [l.lat, l.lng]);
        if (coords.length) map.fitBounds(coords, { padding: [20, 20] });
